function IqR=gen_IqR(sval,Rval)%% Usage: IqR=gen_IqR(sval,Rval)%IqR=zeros(length(sval),length(Rval));%svals=sval.^2;Fau=16.881901*exp(-0.461100/4*svals);Fau=Fau+18.591299*exp(-8.621600/4*svals);Fau=Fau+25.558201*exp(-1.482600/4*svals);Fau=Fau+5.860000*exp(-36.395599/4*svals);Fau=Fau+12.065800;%Fau=Fau-16.25*0.334*exp(-pi*(16.25^(2/3)).*((sval).^2));Faus=Fau.^2;%qval=2*pi*sval;qvalm6=qval.^-6;Rvalm6=Rval.^-6;%for Rind=1:length(Rval)	IqR(:,Rind)=Rvalm6(Rind)*Faus.*qvalm6.*(sin(Rval(Rind)*qval)-Rval(Rind)*qval.*cos(Rval(Rind)*qval)).^2;end